import { Link } from "react-router-dom";
import mock from "./mock.json";

function Home() {
  return (
    <div>
      <h1>MBTI별 좋아하는 컬러</h1>
      <div>
        <Link to="/new">+ 새 컬러 등록하기</Link>
        <ul>
          {mock.map((item) => (
            <li key={item.id}>
              {item.id} {item.mbti} --- {item.colorCode}
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Home;
